css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #797979;
  padding: 7px;
  border-bottom: 1px solid #1e1e1e;
  display: flex;
  align-items: center;
}
.github-Accordion-header::-webkit-details-marker {
  color: #797979;
}
.github-Accordion--rightTitle,
.github-Accordion--leftTitle {
  flex: 1;
}
.github-Accordion-content {
  border-bottom: 1px solid #1e1e1e;
  background-color: #1e1e1e;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #797979;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #F5F5F5;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 3.5px;
  border-bottom: 1px solid #1e1e1e;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #404040;
}
